CREATE TABLE `ref_mata_pelajaran` (
  `mata_pelajaran_id` BIGINT,
  `nama` VARCHAR(1024),
  `pilihan_sekolah` VARCHAR(1024),
  `pilihan_buku` VARCHAR(1024),
  `pilihan_kepengawasan` VARCHAR(1024),
  `pilihan_evaluasi` VARCHAR(1024),
  `jurusan_id` VARCHAR(1024) NULL,
  `create_date` VARCHAR(1024),
  `last_update` VARCHAR(1024),
  `expired_date` VARCHAR(1024) NULL,
  `last_sync` VARCHAR(1024)
);

